const SideBar = () => {
  return (
    <div>
      <button className="button">
        <div>Items1</div>
      </button>
      <button className="button">
        <div>Items2</div>
      </button>
      <button className="button">
        <div>Items3</div>
      </button>
    </div>
  );
};

export default SideBar;
